こうしておけば `state` とは独立に `FooView` の任意の状態を簡単に実現できるので、スナップショットテストやプレビューのためのモックが必要なくなります。↑は SwiftUI の例ですが、UIKit の場合でも、外から渡された状態を再現するだけの VC と、 `state` を保持して状態を伝えるだけの VC とに分離することで、同様のことが実現可能です。

② もう一つは、公開する `state` のプロパティをすべて `@Publsihed public var` にしてしまうことです。そうすれば、スナップショットテストやプレビューの際に、任意の状態の `state` を簡単に作れます。 `UserService` 等にはダミーのテスト用実装を渡して何の仕事もさせないようにします。なお、 computed property の場合は setter を作れないので、↓のように republish する必要が生じます。
