public final class FooViewState<FooService: FooServiceProtocol>: ObserbalbleObject {
    @Published public var baz: String = ""
    @Published public var isQux: Bool = false
    ...
    init(...) {
        ...
        $baz.map(\.isEmpty).assign(to: &$isQux) // republish
    }
    ...
} 
